import React, { Component } from 'react'

class Database  {
    get projects () {
        return [
            {
                id: 1,
                title: 'Jedmap'
            },
            {
                id: 2,
                title: 'Brand Guidlines'
            },
            {
                id: 3,
                title: 'Invest African Guide'
            },
            {
                id: 4,
                title: 'Drops bar'
            }
        ];
    }
    get skills () {
        return [
            {
                id: 1,
                title: 'React'
            },
            {
                id: 2,
                title: 'Sass'
            },
            {
                id: 3,
                title: 'Vanilla JS'
            },
            {
                id: 4,
                title: 'Html'
            },
            {
                id: 5,
                title: 'PHP'
            }
        ]
    }
}

export default new Database;
